description.text:
Use the module to create the desired brick (technically mortar) pattern, then use difference to apply it to a flat surface to create a brick like effect.
Parameter list:<br />
//width - width of the texture (starts a 0 x and goes positive)<br />
//height - height of the texture (starts at 0 z and goes positive)<br />
//brickwidth - width of a brick<br />
//brickheight - height of a brick<br />
//mortarthick - thickness of the mortar line<br />
//mortardeep - depth of the mortar (starts at 0 and goes positive)
